import Project1 from '@/components/Project.vue';
import Project2 from '@/components/Project.vue';
import Project3 from '@/components/Project.vue';
import { createRouter, createWebHashHistory } from 'vue-router';


const routes = [
  { 
    path: '/Projects/PrintCard', 
    name: 'PrintCard', 
    component: Project1, 
    props: { projectCode: 'P0000' , title: 'Print Card', description: 'Description for Print Card' } 
  },
  {
    path: '/Projects/CardDesigner',
    name: 'CardDesigner',
    component: Project2,
    props: { projectCode: 'P0001', title: 'Card Designer', description: 'Description for Card Designer' }
  },
    {
        path: '/Projects/PortfolioWebsite',
        name: 'PortfolioWebsite',
        component: Project,
        props: { projectCode: 'P0002', title: 'Portfolio Website', description: 'Description for Portfolio Website' }
    }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes,
  scrollBehavior() {
    return { top: 0 };
  }
});

export default router;
